function ImagePopup() {
    return (

    <div class="popup popup_element">
      <div class="popup__image-container">
        <button
          type="button"
          class="popup__close_element popup__close"
        ></button>
        <img class="popup__image" />
        <p class="popup__image-title"></p>
      </div>
    </div>
    );
  }

  export default ImagePopup;
